import Vue from "vue";
import {
  Pagination,
  Button,
  Popup,
  NavBar,
  Cell,
  CellGroup,
  DatetimePicker,
  Picker,
  Field,
  Icon,
  Toast,
  ActionSheet,
  Search
} from "vant";

Vue.use(Pagination);
Vue.use(Button);
Vue.use(Popup);
Vue.use(NavBar);
Vue.use(Cell);
Vue.use(CellGroup);
Vue.use(DatetimePicker);
Vue.use(Picker);
Vue.use(Field);
Vue.use(Icon);
Vue.use(Toast);
Vue.use(ActionSheet);
Vue.use(Search);

export default {
  data() {
    return {
      list: [],
      nameInput: "",
      linkInput: "",
      usefulValue: "",
      usefulOptions: [
        {
          value: "选项1",
          label: "是"
        },
        {
          value: "选项2",
          label: "否"
        }
      ],
      usefulColumns: ["有效单", "无效单"],
      formLabelWidth: "120px",
      dialogTableVisible: false,
      currentPage: 1, //当前页
      pagesizes: [20, 40, 60, 80, 100], //单页最大显示条数
      pagesize: 20, //单页内条数
      device: "",
      mobileSearchShow: false,
      mobileSearchButtonLoading: false
    };
  },
  created() {
    this.list = [
      {
        name: "综合管理",
        linkAddress: "",
        isUseful: "可用"
      },
      {
        name: "订单总管理",
        linkAddress: "",
        isUseful: "可用"
      },
      {
        name: "头条管理",
        linkAddress: "",
        isUseful: "可用"
      },
      {
        name: "趣头条管理",
        linkAddress: "",
        isUseful: "可用"
      }
    ];
    this.listLoading = false;
    this.device = this.$store.state.app.device;
  },
  computed: {
    deviceVal() {
      return this.$store.state.app.device;
    }
  },
  watch: {
    deviceVal(newVal, oldVal) {
      this.device = newVal;
    }
  },
  methods: {
    handleTimeSlot(row, column, cell, event) {
      this.channelTitle = row.channel;
      if (this.device == "mobile") {
        if (column.label == undefined) {
          this.mobileDetailShow = true;
        }
      } else {
        if (column.label == undefined) {
          this.dialogTableVisible = true;
        } else {
        }
      }
    },
    handleSizeChange(val) {
      this.listLoading = true;
      setTimeout(() => {
        this.pagesize = val;
        this.listLoading = false;
      }, 500);
    },
    //选择表格当前页数
    handleCurrentChange(val) {
      this.listLoading = true;
      setTimeout(() => {
        this.currentPage = val;
        this.listLoading = false;
      }, 500);
    },
    //新增
    handleAdd() {},
    handleSearch() {},
    handleClick(row) {},
    handleAdd() {},
    handleDelete() {},
    /* 移动端事件 */
    //新增
    handleSearchMobile() {},
    //取消新增
    handleAddMobileCancel() {},
    //确认新增
    handleMobileAdd() {},
    //清空所选
    handleSearchMobileClearAll() {},
    //分页器改变
    handlePageChange() {},
    //返回列表
    handleDetailCancel() {
      this.mobileDetailShow = !this.mobileDetailShow;
    }
  }
};
